import { StyleSheet } from 'react-native';
import EditScreenInfo from '../components/EditScreenInfo';
import Frame from '../components/Frame';
import ScrollingFrame from '../components/ScrollingGrid';
import { Text, View } from '../components/Themed';
import { RootTabScreenProps } from '../types';

export default function TabOneScreen({ navigation }: RootTabScreenProps<'TabOne'>) {
  const testArr = [1, 2, 3, 4, 5]

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Tab One</Text>
      <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />
      <EditScreenInfo path="/screens/TabOneScreen.tsx" />
      <ScrollingFrame size={500} data={testArr} gradient='linear-gradient(45deg, red, 50%, orange)' shadow={0.5} style={{ top: 0, left: 0, position: 'relative' }} numColumns={3} gridPadding={0}>
      </ScrollingFrame>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
